import React from 'react';
import logo from './logo.svg';
import './App.css';
import Table from "./components/table";
import { Alert } from 'reactstrap'
import {Button} from 'reactstrap'
import 'bootstrap/dist/css/bootstrap.css';
import ModalExample from "./components/modal";
import ExampleNav from "./components/nav";
import Navbar from "reactstrap/es/Navbar";
import TableR from "./components/tableR";
import SoldierTable from "./components/soldierTable";
import paginationFactory from 'react-bootstrap-table2-paginator';
import Pagination from "reactstrap/es/Pagination";
import { TableSimple } from 'react-pagination-table';
let users=[];
function buildFakeUser() {
    return {
        name:'1',
        avatar:'2',
        email:'3',
        color:'4'
    };
}

for(var i = 0; i < 25; i++) {
    users.push(buildFakeUser())
}


function App() {
  return (
      <div>
        <ExampleNav/>
        <TableSimple
            title="TableSimple"
            subTitle="Sub Title"
            data={ users }
            columns="name.avatar.email.phone.color"
            perPageItemCount={ 5 }
            totalCount={ users.length }
        />
        {/*<SoldierTable/>*/}
      </div>
  );
}

export default App;
